import React from 'react'

import { modelImage } from '../actions/productActions'
import { useDispatch, useSelector } from 'react-redux'


function AiModelScreen(text) {  

  const dispatch = useDispatch()
  const modelImage = useSelector(state => state.modelImage)
  const { error, loading, image } = modelImage

  useEffect(() => {
    dispatch(modelImage())

  }, [])

  return (
    <div>
      <h1> Stable Diffusion Model</h1>
      <Link to={`/model/?text=${text}`}>
      </Link>
    </div>
  )
}

export default AiModelScreen
